// src/components/Header.js

import React from 'react';
import { Link } from 'react-router-dom';

const Header = () => {
  return (
    <header className="bg-black bg-opacity-50 backdrop-filter backdrop-blur-md fixed w-full z-10">
      <div className="container mx-auto px-4 py-4 flex justify-between items-center">
        <Link to="/" className="text-2xl font-bold text-gradient bg-primary-gradient">
          IIT Guwahati Ride Share
        </Link>
        <nav className="hidden md:flex space-x-4">
          <Link to="/about" className="hover:text-purple-400 transition duration-300">About</Link>
          <Link to="/features" className="hover:text-purple-400 transition duration-300">Features</Link>
          <Link to="/contact" className="hover:text-purple-400 transition duration-300">Contact</Link>
          <button className="px-4 py-2 bg-purple-600 text-white rounded-full hover:bg-purple-700 transition duration-300">
            Sign In
          </button>
        </nav>
      </div>
    </header>
  );
};

export default Header;
